import React from 'react'
import './index.css';
import Brand from './Brand'
import MainMenu from './MainMenu';
import Common from './Common';

const LeftNavigationBar = () => {
  return (
    <div>
        <Brand/>
        <MainMenu/>
        <Common name="Dashboard" img="./images/dashboard.png"/>
        <Common name="Recruitment" img="./images/g7.png"/>
        <Common name="Schedule" img="./images/schedule.png"/>
        <Common name="Employee" img="./images/logo.png"/>
        <Common name="Department" img="./images/logo.png"/>
    </div>
  )
}

export default LeftNavigationBar
